'use strict';function bindSlick(){$('.sidescroll .images').slick({dots:!1,infinite:!0,speed:300,slidesToShow:20,centerMode:!0,initialSlide:0,variableWidth:!0,arrows:!0,draggable:!0,swipeToSlide:!0,slidesToScroll:1,autoplay:!1,autoplaySpeed:3e3,useTransform:!1})}function unbindSlick(){$('.sidescroll .images').slick('unslick')}function handleSlick(){window.innerWidth>1600?bindSlick():unbindSlick()}document.addEventListener('DOMContentLoaded',function(){window.addEventListener('load',function(){handleSlick()});var n;window.addEventListener('resize',function(){clearTimeout(n),n=setTimeout(function(){handleSlick()},100)})}),document.addEventListener('DOMContentLoaded',function(){$('.main-nav ul ul').parent().addClass('parent')});